import React from 'react';

import { auth } from '../../firebase';

const SignOutButton = () =>
  <button
    class="btn btn-outline-warning pull-right"
    type="button"
    onClick={auth.doSignOut}
  >
    Sign Out
  </button>

export default SignOutButton;
